import React from 'react';
import { Logo, Nav } from '../../ui';
import { StyledFooter } from './styles';

interface IFooterProps {
}

const Footer: React.FC<IFooterProps> = props => {
  return (
    <StyledFooter>
      <Logo light style='grid-area: logo'/>
      <Nav light />
    </StyledFooter>
  )
};

export default Footer;
